
local _M = { }

function _M:Init()
    for key, item in pairs(self.Data) do
        item.__index = item
        for subKey, subItem in pairs(item.starLevel_List) do
            setmetatable(subItem, item)
        end
    end
end

function _M:Get(id, starLevel)
    local item = self.Data[id]
    local subItem = nil 
    if item then
        subItem = item.starLevel_List[starLevel]
    end

    return subItem
end

